      // visualization to make sure not to delete handlers for other profvis
      // visualizations on the same page (this can happen with Rmd documents).
      $(window).off("resize.profvis." + resizeCallbackNamespace);
      $(window).on("resize.profvis." + resizeCallbackNamespace, resizePanelsDebounced);

      // Get current proportional position of split bar
      function splitProportion() {
        var splitCenter;

        if (vis.splitDir === "v") {
          splitCenter = $splitBar.offset().left - $panel1.offset().left +
                            $splitBar.outerWidth()/2;
          var innerWidth = offsetRight($panel2) - $panel1.offset().left;
          return splitCenter / innerWidth;

        } else if (vis.splitDir === "h") {
          splitCenter = $splitBar.offset().top - $panel1.offset().top +
                            $splitBar.outerHeight()/2;
          var innerHeight = offsetBottom($panel2) - $panel1.offset().top;
          return splitCenter / innerHeight;
        }
      }

      function positionRight($el) {
        return $el.position().left + $el.outerWidth();
      }
      function offsetRight($el) {
        return $el.offset().left + $el.outerWidth();
      }
      function positionBottom($el) {
        return $el.position().top + $el.outerHeight();
      }
      function offsetBottom($el) {
        return $el.offset().top + $el.outerHeight();
      }

      // Enable dragging of the split bar ---------------------------------------
      (function() {
        var dragging = false;
        // For vertical split (left-right dragging)
        var startDragX;
        var startOffsetLeft;
        // For horizontal split (up-down dragging)
        var startDragY;
        var startOffsetTop;

        var stopDrag = function(e) {
          if (!dragging) return;
          dragging = false;

          document.removeEventListener("mousemove", drag);
          document.removeEventListener("mouseup", stopDrag);

          $splitBar.css("opacity", "");

          if ((vis.splitDir === "v" && e.pageX - startDragX === 0) ||
              (vis.splitDir === "h" && e.pageY - startDragY === 0)) {
            return;
          }

          resizePanels(splitProportion());
          vis.flameGraph.onResize();
        };

        var startDrag = function(e) {
          // Don't start another drag if we're already in one.
          if (dragging) return;
          dragging = true;
          pauseEvent(e);

          $splitBar.css("opacity", 0.75);

          if (vis.splitDir === "v") {
            startDragX = e.pageX;
            startOffsetLeft = $splitBar.offset().left;
          } else {
            startDragY = e.pageY;
            startOffsetTop = $splitBar.offset().top;
          }

          document.addEventListener("mousemove", drag);
          document.addEventListener("mouseup", stopDrag);
        };

        var drag = function(e) {
          if (!dragging) return;
          pauseEvent(e);

          if (vis.splitDir === "v") {
            var dx = e.pageX - startDragX;
            if (dx === 0)
              return;

            // Move the split bar
            $splitBar.offset({ left: startOffsetLeft + dx });

          } else if (vis.splitDir === "h") {
            var dy = e.pageY - startDragY;
            if (dy === 0)
              return;

            // Move the split bar
            $splitBar.offset({ top: startOffsetTop + dy });
          }
        };

        // Stop propogation so that we don't select text while dragging
        function pauseEvent(e){
          if(e.stopPropagation) e.stopPropagation();
          if(e.preventDefault) e.preventDefault();
          e.cancelBubble = true;
          e.returnValue = false;
          return false;
        }

        // Remove existing event listener from previous calls to initResizing().
        $splitBar.off("mousedown.profvis");
        $splitBar.on("mousedown.profvis", startDrag);
      })();


      return {
        resizePanels: resizePanels
      };
    }


    var prof = prepareProfData(message.prof, message.interval);

    var vis = {
      el: el,
      prof: prof,
      profTree: getProfTree(prof),
      interval: message.interval,
      totalTime: getTotalTime(prof),
      totalMem: getTotalMemory(prof),
      files: message.files,
      aggLabelTimes: getAggregatedLabelTimes(prof),
      fileLineStats: getFileLineStats(prof, message.files),
      profTable: [],

      // Objects representing each component
      statusBar: null,
      optionsPanel: null,
      codeTable: null,
      flameGraph: null,
      infoBox: null,
      treetable: null,
      activeViews: [],

      // Functions to enable/disable responding to scrollwheel events
      enableScroll: enableScroll,
      disableScroll: disableScroll,

      splitDir: message.split,

      hideMemory: false,

    var panel1 = document.createElement("div");

    var panel2 = document.createElement("div");
    panel2.className = "profvis-panel2";
    vis.el.appendChild(panel2);

    var splitBarEl = document.createElement("div");
    splitBarEl.className = "profvis-splitbar";
    vis.el.appendChild(splitBarEl);

  // Calculate amount of time spent on each line of code. Returns nested objects
  // grouped by file, and then by line number.
  function getFileLineStats(prof, files) {
    // Drop entries with null or "" filename
    prof = prof.filter(function(row) {
      return row.filename !== null && row.filename !== "";
    });

    // Gather line-by-line file contents
    var fileLineStats = files.map(function(file) {
      // Create array of objects with info for each line of code.
      var lines = file.content.split("\n");
      var lineData = [];
      var filename = file.filename;
      var normpath = file.normpath;
      for (var i=0; i<lines.length; i++) {
        lineData[i] = {
          filename: filename,
          normpath: normpath,
          linenum: i + 1,
          content: lines[i],
          sumTime: 0,
          sumMem: 0,
          sumMemAlloc: 0,
          sumMemDealloc: 0
        };
      }

      return {
        filename: filename,
        lineData: lineData
      };
    });

    // Get timing data for each line
    var statsData = d3.nest()
      .key(function(d) { return d.filename; })
      .key(function(d) { return d.linenum; })
      .rollup(function(leaves) {
        var sumTime = leaves.reduce(function(sum, d) {
          // Add this node's time only if no ancestor node has the same
          // filename and linenum. This is to avoid double-counting times for
          // a line.
          var incTime = 0;
          if (!ancestorHasFilenameLinenum(d.filename, d.linenum, d.parent)) {
            incTime = d.endTime - d.startTime;
          }
          return sum + incTime;
        }, 0);

        var sumMem = leaves.reduce(function(sum, d) {
          return sum + d.sumMem;
        }, 0);

        var sumMemDealloc = leaves.reduce(function(sum, d) {
          return sum + d.sumMemDealloc;
        }, 0);

        var sumMemAlloc = leaves.reduce(function(sum, d) {
          return sum + d.sumMemAlloc;
        }, 0);

        return {
          filename: leaves[0].filename,
          linenum: leaves[0].linenum,
          sumTime: sumTime,
          sumMem: sumMem,
          sumMemAlloc: sumMemAlloc,
          sumMemDealloc: sumMemDealloc
        };
      })
      .entries(prof);

    // Insert the sumTimes into line content data
    statsData.forEach(function(fileInfo) {
      // Find item in fileTimes that matches the file of this fileInfo object
      var fileLineData = fileLineStats.filter(function(d) {
        return d.filename === fileInfo.key;
      })[0].lineData;

      fileInfo.values.forEach(function(lineInfo) {
        lineInfo = lineInfo.values;
        fileLineData[lineInfo.linenum - 1].sumTime = lineInfo.sumTime;
        fileLineData[lineInfo.linenum - 1].sumMem = lineInfo.sumMem;
        fileLineData[lineInfo.linenum - 1].sumMemDealloc = lineInfo.sumMemDealloc;
        fileLineData[lineInfo.linenum - 1].sumMemAlloc = lineInfo.sumMemAlloc;
      });
    });

    // Calculate proportional times, relative to the longest time in the data
    // set. Modifies data in place.
    var fileMaxTimes = fileLineStats.map(function(lines) {
      var lineTimes = lines.lineData.map(function(x) { return x.sumTime; });
      return d3.max(lineTimes);
    });

    var maxTime = d3.max(fileMaxTimes);

    fileLineStats.map(function(lines) {
      lines.lineData.map(function(line) {
        line.propTime = line.sumTime / maxTime;
      });
    });

    var totalMem = getTotalMemory(prof);

    fileLineStats.map(function(lines) {
      lines.lineData.map(function(line) {
        line.propMem = line.sumMem / totalMem;
        line.propMemDealloc = line.sumMemDealloc / totalMem;
        line.propMemAlloc = line.sumMemAlloc / totalMem;
      });

ull,null,null,null,null,null,null,null,null,"core_functions.R","core_functions.R","<expr>","core_functions.R","core_functions.R","core_functions.R","core_functions.R","<expr>","core_functions.R","core_functions.R","<expr>",null,null,"core_functions.R","core_functions.R","core_functions.R","<expr>","core_functions.R","core_functions.R","<expr>","core_functions.R","core_functions.R","<expr>","core_functions.R","core_functions.R","<expr>",null,"core_functions.R","core_functions.R","<expr>",null,"core_functions.R","core_functions.R","<expr>",null,"core_functions.R","core_functions.R","<expr>",null,"core_functions.R","core_functions.R","<expr>",null,"core_functions.R","core_functions.R","<expr>",null,"core_functions.R","core_functions.R","<expr>","core_functions.R","<expr>",null,null,"core_functions.R","core_functions.R","<expr>","core_functions.R","core_functions.R","core_functions.R","core_functions.R","<expr>","core_functions.R","core_functions.R","core_functions.R","<expr>","core_functions.R","core_functions.R","<expr>","core_functions.R","core_functions.R","<expr>","core_functions.R","core_functions.R","<expr>",null,null,null,null,null,null,null,null,"core_functions.R","core_functions.R","core_functions.R","<expr>",null,null,"core_functions.R","core_functions.R","<expr>","core_functions.R","<expr>",null,null,"core_functions.R","core_functions.R","core_functions.R","core_functions.R","core_functions.R","<expr>","core_functions.R","core_functions.R","core_functions.R","core_functions.R","<expr>","core_functions.R","core_functions.R","<expr>",null,null,null,null,"core_functions.R","core_functions.R","core_functions.R","core_functions.R","core_functions.R","core_functions.R","<expr>",null,null,null,"core_functions.R","core_functions.R","core_functions.R","<expr>"]},"interval":10,"files":[{"filename":"<expr>","content":"profvis::profvis({out <- run(steps, initial_population)})\n","normpath":"<expr>"},{"filename":"core_functions.R","content":"# core_functions.R\n\n# functions to extract tick age, process, and infection status from life_stage name\n# currently these are just used for graphing\n\n# return age of tick in life_stage\n# e.g. age(\"fl\") = \"l\"\nage <- function(life_stage) {\n  substr(life_stage, str_length(life_stage), str_length(life_stage))\n}\n\n# return current process of tick in life_stage\nprocess <- function(life_stage) {\n  ifelse(substr(life_stage, 0, 1) != '', substr(life_stage, 0, 1), '')\n}\n\n# return whether a life_stage is infected\n# unlike the 3 previous and similar functions, infected() returns a boolean\ninfected <- function(life_stage) {\n  str_detect(life_stage, \"i\")\n  \n}\n\n# 01 functions to grab the predictors that determine the transition probabiltiies at a given time\n\n# extract temperature from input data at time time \nget_temp <- function(time) {\n  weather[which(weather$j_day %in% time), ]$tmean\n}\n\n# extract vapour-pressure deficit from input data at time time \nget_vpd <- function(time) {\n  weather %>% \n    filter(j_day %in% time) %>%\n    pull(vpdmean)\n} \n\nget_host_den <- function(time) {\n  host_comm[which(host_comm$j_day %in% time), ]$host_den\n}\n\n# Return a vector of a predictor at time time. \n# The vector's length is based on whether the transition is_delay.\nget_pred <- function(time, pred, is_delay, N, N_developing) {\n  \n  # if is_delay, we want a long vector so the cumsum will reach 1\n  # otherwise, we want a vector of length 1\n  if (is_delay) {time <- time:(time + max_delay)}\n  \n  if (is.na(pred)) {\n    return(NULL)\n  } else if (pred == \"temp\") {\n    return(get_temp(time))\n  } else if (pred == \"vpd\") {\n    return(get_vpd(time))\n  } else if (pred == \"host_den\") {\n    return(get_host_den(time[1])) # length == n_host_spp\n  } else if (any(str_detect(life_stages, pred))) {\n    return(sum((N + N_developing)[str_subset(life_stages, pred), time[1]])) # length == 1\n  } else {\n    print(\"error: couldn't match pred\")\n  }\n}\n\n# 03\n# calculate individual transition probabilities for advancing to consecutive life stage\n\n# This generic function will pull out the functional form and parameters needed to make the transition function, \n# then evaluate it using supplied predictors (pred1, pred2) like temperature or host density\n# This approach takes an entire transition_row, since there can be multiple rows with the same 'from' and 'to'\n# transition_row: a row from the tick_transitions tibble\nget_transition_val <- function(time, transition_row_with_parameters, N, N_developing) {\n  \n  f <- get(transition_row_with_parameters[['transition_fun']])\n  \n  params <- transition_row_with_parameters[['params_list']]\n  \n  pred1 <- get_pred(time, transition_row_with_parameters[['pred1']], \n                    transition_row_with_parameters[['delay']], N, N_developing)\n  pred2 <- get_pred(time, transition_row_with_parameters[['pred2']], \n                    transition_row_with_parameters[['delay']], N, N_developing)\n  \n  do.call(f, c(list(pred1, pred2), params[[1]]))\n}\n\n\n# 04\n# at each step, we generate a new transition matrix whose transition probabilities\n# are based on the input data (weather, host_community) at that time \ngen_trans_matrix <- function(time, N, N_developing) {\n  \n  # initialize the transition matrix with 0s\n  n_life_stages <- length(life_stages)\n  trans_matrix <- matrix(0, ncol = n_life_stages, nrow = n_life_stages, \n                         dimnames = list(life_stages, life_stages))\n  \n  transitions <- tick_transitions %>% \n    filter(delay == 0,\n           to %in% life_stages)  # exclude mortality\n  \n  mort <- tick_transitions %>%\n    filter(delay == 0, \n           !(to %in% life_stages))\n  \n  if (nrow(transitions) > 0) {\n    for (t in seq_len(nrow(transitions))) {\n      trans_matrix[transitions[t,]$from, transitions[t,]$to] <- \n        get_transition_val(time, transitions[t, ], N, N_developing)\n    }\n  }\n  \n  if (nrow(mort) > 0) {\n    for (m in seq_len(nrow(mort))) {\n      from_stage <- mort[m,]$from\n      \n      mortality <- get_transition_val(time, mort[m,], N, N_developing) \n      trans_prob_sum <- sum(trans_matrix[from_stage,], mortality)\n      \n      # sum of transition probabilities plus mortality should not exceed 1\n      # unless we're coming from a reproductive stage\n      if (trans_prob_sum > 1 && !str_detect(from_stage, 'r.a')) {\n        stop('transition probability from ', from_stage, ' = ', trans_prob_sum, ', but should be <= 1')\n      }\n      \n      # The max(0, 1- ...) structure should ensure that survival is between 0 and 1\n      # This line also ensures that when a reproductive tick lays (multiple) eggs, the\n      # reproductive tick will not survive to the next stage. This is the desired behavior because\n      # all ticks are semelparous.\n      trans_matrix[from_stage, from_stage] <- max(0, 1 - sum(trans_matrix[from_stage,]) - mortality)\n    }\n  }\n  \n  return(trans_matrix)\n}\n\n\n# based on the current time, delay_arr and N (population matrix), return a delay_arr for the next time step\nupdate_delay_arr <- function(time, delay_arr, N, N_developing) {\n  \n  # select all delay transition functions, including mortality\n  transitions <- tick_transitions[tick_transitions$delay == 1, ]\n  \n  # loop through these transitions by from_stage \n  from_stages <- unique(pull(transitions, from))\n  for (from_stage in from_stages) {\n    \n    # for a given delay transition, every \"from\" stage has a unique \"to\" stage\n    trans <- transitions[transitions$from == from_stage &\n                           transitions$to %in% life_stages, ]\n    \n    to_stage <- trans[['to']]\n    \n    # daily probability of transitioning to the next stage\n    val <- get_transition_val(time, trans, N, N_developing)\n    \n    # daily or per capita mortality during the delayed transition\n    # each \"from\" stage has either 1 or 0 corresponding mortality transitions\n    \n    mort_tibble <- transitions[transitions$from == from_stage &\n                                 !(transitions$to %in% life_stages), ]\n    \n    if(nrow(mort_tibble) == 1) {\n      mort <- get_transition_val(time, mort_tibble[1,], N, N_developing)    \n    } else if (nrow(mort_tibble) == 0) {\n      mort <- 0 \n    } else {\n      stop(nrow(mort_tibble), ' mortality transitions found from a single stage, should be 1 or 0')\n    }\n    \n    # Constant functions (for a fixed delay transition) return a single value\n    # We increase the length so that we can do a cumsum over the vector\n    # We add 1 for consistency with output vector length from non-constant fxns,\n    # which is determined by time:(time + max_delay) in get_pred()\n    if (length(val) == 1) val <- rep(val, max_delay + 1)\n    \n    days <- cumsum(val) >= 1\n    \n    if (any(days)) {\n      \n      # delay duration is the number of days until the first day when the sum\n      # of the daily probabilities >= 1\n      days_to_next <- min(which(days))\n      \n      if (length(mort) > 1) {\n        # Non-constant mortality\n        # We might ultimately want density_fun() to return a vector of length > 1,\n        # where the value for each day is calculated based on that day's feeding tick population\n        # But currently, all mortality transitions are either constant_fun() or density_fun(), \n        # both of which return a vector of length 1, so we shouldn't ever get to this case.\n        print('non-constant mortality')\n        \n        # in this case, mort is a vector of length max_delay?\n        # we susbet it for the duration of the delay\n        # then elementwise subtract (1 - each element) to get vector of daily survival rate,\n        # and take product to get the overall survival rate throughout the delay\n        surv_to_next <- prod(1 - mort[1:days_to_next])\n        \n      } else if (nrow(mort_tibble) == 1 && mort_tibble['to'] == 'per_capita_m') {\n        # Apply per capita mortality once during transition, rather than every day\n        surv_to_next <- 1 - mort\n        \n      } else {\n        # Constant mortality\n        surv_to_next <- (1 - mort) ^ days_to_next\n      }\n      \n      # number of ticks emerging from from_stage to to_stage at time + days_to_next is the number of ticks \n      # that were already going to emerge then plus the current number of ticks in the from_stage * survival\n      # delay_arr[to_stage, from_stage, time + days_to_next] <- \n      #   delay_arr[to_stage, from_stage, time + days_to_next] +\n      #   N[from_stage, time] * surv_to_next\n      \n      delay_arr[from_stage, to_stage, time + days_to_next] <- \n        delay_arr[from_stage, to_stage, time + days_to_next] + \n        N[from_stage, time] * surv_to_next\n    }\n  }\n  return(delay_arr)\n}\n\n# return list of parameters for a given transition_row\nget_params <- function(from, to, parameters = tick_params) {\n  \n  string <- paste0(from, to)\n  patterns <- paste0(parameters$from, parameters$to)\n  \n  params_tbl <- parameters[str_which(string, patterns), ]\n  \n  params <- params_tbl$param_value\n  names(params) <- params_tbl$param_name\n  params <- split(unname(params), names(params))\n  \n  params\n}\n\n# return a new tick_transitions tibble with a column, params_list\n# that is a named list of the parameters for each transition\nadd_params_list <- function(tick_transitions, parameters = tick_params) {\n  \n  # TODO should be a vectorized approach\n  params_list <- list()\n  \n  for (i in 1:nrow(tick_transitions)) {\n    p <- get_params(tick_transitions[[i,'from']], tick_transitions[[i, 'to']])\n    params_list[[i]] <- p\n  }\n  \n  mutate(tick_transitions, params_list = params_list)\n}\n\n\n# 05 iteratively run model for steps iterations, starting with initial_population\nrun <- function(steps, initial_population) {\n  \n  # update the tick transitions global variable by adding parameters \n  # for each transition\n  # TODO would be better not to update a global variable\n  tick_transitions <<- add_params_list(tick_transitions)\n  \n  # initialize a delay array of all zeros\n  # dimensions: to, from, time\n  # dimensions: from, to, time\n  delay_arr <- array(dim = c(length(life_stages), length(life_stages), steps + max_delay),\n                     dimnames = list(life_stages, life_stages, NULL),\n                     data = 0)\n  \n  \n  # intialize a population matrix with initial_population\n  N <- matrix(nrow = length(life_stages), ncol = steps, data = 0)\n  N[,1] <- initial_population \n  rownames(N) <- life_stages\n  \n  # Initialize a population matrix to keep track of the number of individuals of each stage\n  # that are currently developing (currently undergoing a delay)\n  N_developing <- matrix(nrow = length(life_stages), ncol = steps, data = 0)\n  rownames(N_developing) <- life_stages\n  \n  # at each time step:\n  # (1) generate a new trans_matrix based on conditions at \"time\"\n  # (2) update the delay_arr based on conditions at \"time\" \n  # (3) update the population matrix \"N\" for \"time + 1\"\n  \n  # at each time step\n  for (time in 1:(steps - 1)) {\n    \n    if (time %% 100 == 0) print(paste(\"day\", time))\n    \n    # Calculate the number of ticks currently in delayed development NOT INCLUDING those \n    # added on current day, because that would be double counting ticks in the population matrix, N. \n    # We exclude those added on current day by calculating N_developing before updating delay_arr\n    # Slice the delay array from the current time + 1 to the end. We add 1 because ticks that \n    # emerge from delay at current time would have been added to N on the previous iteration \n    # when we update N[, time + 1] by adding delay_mat[, time + 1]\n    # sum across columns (to_stage)\n    # sum across rows (days)\n    # Result is a vector of the number of ticks currently developing FROM each life stage\n    # N_developing[, time] <- rowSums(colSums(delay_arr[,,(time + 1):dim(delay_arr)[3]]))\n    N_developing[, time] <- rowSums(delay_arr[,,(time + 1):dim(delay_arr)[3]])\n    \n    # calculate transition probabilities\n    trans_matrix <- gen_trans_matrix(time, N, N_developing)\n    \n    # calculate the number of ticks entering delayed development\n    delay_arr <- update_delay_arr(time, delay_arr, N, N_developing)\n    \n    # collapse the delay_arr by summing across 'from', giving a matrix with dims = (to, days)\n    # delay_mat <- apply(delay_arr, 3, rowSums)\n    delay_mat <- colSums(delay_arr)\n    \n    # calculate the number of ticks at the next time step, which is \n    # current population * transition probabilities + ticks emerging from delayed development\n    N[, time + 1] <- N[, time] %*% trans_matrix + delay_mat[, time + 1]\n  }\n  \n  # the population matrix N and delay_mat are local variables\n  # we return them here after running \"steps\" times\n  return(list(N, N_developing, delay_mat))\n}\n","normpath":"/Users/myles/Documents/midd/ticks/IxPopDyMod/core_functions.R"},{"filename":"user_defined_functions.R","content":"# user_defined_functions.R\n\n# 02 functional forms for transition probabilities\n## DA Note: this might want to be moved to a new file, maybe part of input?\n## DA Note: in the simple example can we show a simpiler verison of a host comm?\n\nexpo_fun <- function(x, y, a, b) ifelse(x>0, a*x^b, 0)\nconstant_fun <- function(x, y, a) a\n\n# first part is chance they find a host and second part is success of feeding on them\nfind_n_feed <- function(x, y, a, pref, feed_success)\n  (1 - (1-a)^(sum(x * pref)/sum(pref))) *   sum(x * pref * feed_success/sum(x*pref))\n\n# product of binomial and briere functions\n# (prob of finding a host) * (prob of active questing)\nfeed_fun <- function(x, y, a, pref, q, tmin, tmax)\n  (1 - (1-a)^(sum(x * pref))) * ifelse(y>tmin & y<tmax, q*y*(y-tmin)*sqrt(tmax-y), 0)\n\n# (const prob of finding a host) * (prob of active questing)\nogden_feed_fun <- function(x, y, a, q, tmin, tmax)\n  a * ifelse(x>tmin & x<tmax, q*x*(x-tmin)*sqrt(tmax-x), 0)\n\n# Return the probability that a feeding tick becomes infected or uninfected engorged\n# Since density dependent mortality is subtracted later, in this function we assume\n# that all feeding ticks feed successfully and become engorged\ninfect_fun <- function(x, y, from_infected, to_infected, host_rc, pref)\n  sum(ifelse(rep(from_infected, n_host_spp),\n             1, # stay infected\n             (ifelse(rep(to_infected, n_host_spp),\n                     host_rc, # become infected\n                     1 - host_rc))) * # stay uninfected\n        (x * pref) / sum(x * pref)) # chance a tick is feeding on each host type\n\n\n# density dependent mortality\n# x = host_den, y = number of feeding ticks\ndensity_fun <- function(x, y, a, b, c, pref)\n  sum((a + (b * log((c + y * pref * x / sum(pref * x)) / x))) * pref * x / sum(pref * x))\n","normpath":"/Users/myles/Documents/midd/ticks/IxPopDyMod/user_defined_functions.R"}],"prof_output":"/Users/myles/Documents/midd/ticks/IxPopDyMod/.Rproj.user/D5EBB3B5/profiles-cache/filedba91d4fc7f.Rprof","highlight":{"output":["^output\\$"],"gc":["^<GC>$"],"stacktrace":["^\\.\\.stacktraceo(n|ff)\\.\\.$"]},"split":"h"}},"evals":[],"jsHooks":[]}</script>
